import { mdx } from '@mdx-js/react'

/* @jsx mdx */
import Post from "@/components/Post"

import { waynedahlberg } from "@/authors";
import image1 from "./r2d2-7512.jpg";
import image2 from "./r2d2-7513.jpg";
import image3 from "./r2d2-7514.jpg";
import image4 from "./r2d2-7515.jpg";
export { getStaticProps } from "@/getStaticProps";
export const meta = {
  title: `Hydro Dome Arrived`,
  description: `Now this is podracing.`,
  date: "2016-02-15T14:24:00.000Z",
  authors: [waynedahlberg],
  discussion: "https://github.com/tailwindlabs/tailwindcss/discussions/2511"
};
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  meta
};
const MDXLayout = (props) => <Post meta={meta} {...props} />
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">




    <p>{`This evening I unboxed the Hydrodomes (inner, outer, and support rings) from GraniteEarth.com.`}</p>
    <p>{`These parts are laser-cut. They have significant burring, and will need to be first on the to-do list. I’ll need to secure a set of sand paper grits, steel wool, and Brillo pads to clean up the edges all around. Luckily I have some `}<a parentName="p" {...{
        "href": "http://www.walmart.com/ip/Eagle-One-Nevr-Dull-5-oz./15125758"
      }}>{`NEVR-DULL polish`}</a>{` from when I cleaned up the pipes on my Triumph. This little droid is going to SHINE.`}</p>
    <p>{`Here’s a few photos:`}</p>
    <img src="{image1}" alt="" />
    <img src="{image2}" alt="" />
    <img src="{image3}" alt="" />
    <img src="{image4}" alt="" />

    </MDXLayout>;
}

